  string interimtype = "";
  bool isnonstock = false;
  string Description = "";

  bool available_part = UDMethods.GetPartDescription(Context.CompanyID, Inputs.var_part1.Value, out Description);

  if (available_part) {
    Inputs.var_desc1.Value= Description;
		string PartIUM = "";

		bool result = UDMethods.GetPartIUM(Context.CompanyID, Inputs.var_part1.Value, out PartIUM);

    if (result)
        Inputs.var_uom1.Value = PartIUM;

		string typecd = "";
		result = UDMethods.GetPartTypeCode(Context.CompanyID, Inputs.var_part1.Value, out typecd);
		if (result)
			interimtype = typecd;

  }
  bool NonStock = false;
  bool available_partplant = UDMethods.GetPartPlantNonStock(Context.CompanyID, Inputs.var_part1.Value, out NonStock);

  if (available_partplant) {
    isnonstock = NonStock;
  }

if ((interimtype == "M") && ( isnonstock == true)) {Inputs.var_type1.Value = "M";}
if ((interimtype == "M") && ( isnonstock == false)) {Inputs.var_type1.Value = "P";}
if (interimtype == "P") {Inputs.var_type1.Value = "P";}
}








